window.bookSummaryJSON = "<p>\"Do you know what a papal conclave is?\"</p> <p>Damon: Will is gone. He hasn't been seen in months, and the texts coming from his phone are almost certainly forged. Something's wrong. We need to act now.</p> <p>Michael is ready to tear down The Cove, Rika's hiding something, Evans Crist is a threat, and Winter's father is still out there. Everyone is off in a million directions, and we're vulnerable. It's time to do this. It's time to claim our place.</p> <p>Rika: A few years ago, I never thought I'd be here. On board Pithom. Miles out at sea. At a table with Michael Crist, Kai Mori, and Damon Torrance - men I now consider family.</p> <p>We've locked ourselves on this yacht for however long it takes to address our agenda, and we won't leave until everything is on the table. Even things I don't want to talk about. Things Michael doesn't know.</p> <p>We will find Will. We will solidify our plans, and we will remove any threats. If we survive Conclave.</p> <p><b>Contains mature themes.</b></p>"; 
